import { useState } from "react";
import { Button, Box } from "@mui/material";
import ContactUsDialog from '../../Dialog/ContactUsDialog';

function ContactUs() {
  const [open, setOpen] = useState(false);

  return (
    <Box textAlign="center" p={3}>
      <h2>Contact Us</h2>
      <h4>Please click below to contact us</h4>
      <Button variant="contained" SX={{background: "#333", width: "20%"}} onClick={() => setOpen(true)}>
        Contact Us
      </Button>

      <ContactUsDialog open={open} onClose={() => setOpen(false)} />
    </Box>
  );
}

export default ContactUs;
